import React from "react";
import { useParams } from "react-router-dom";

function FreeBoardDetailPage() {
    const { id } = useParams();

    // 실제로는 여기서 백엔드에서 글 데이터를 fetch 해야 함
    return (
        <div className="w-full max-w-3xl mx-auto py-10 px-4">
            <h1 className="text-2xl font-bold text-[#3D4EFE] mb-2">
                자유게시판 글 상세보기
            </h1>
            <p className="text-sm text-gray-500 mb-6">글 번호: {id}</p>
            <p>✏️ 이 자리에 글 내용을 출력합니다. (API 연동 예정)</p>
        </div>
    );
}

export default FreeBoardDetailPage;
